import { useState,use, useEffect } from 'react';
import './App.css';
const App=()=> {
  const [counter,setCounter] =useState(0);
  useEffect(()=>{
counter=100
  });
  return (
    <div className="App">
        <button onClick={()=>setCounter((prevCount)=>prevCount-1)}>-</button>
        <h1>{counter}</h1>
        <button onClick={()=>setCounter((prevCount)=>prevCount+1)}>+</button>
    </div>
  );
}

export default App;
